import React from 'react'

const SignalPage = () => {
	return (
		<div>
			<h1>Сигналы для трейдинга</h1>
			<p>Здесь будут отображаться актуальные сигналы для трейдинга.</p>
		</div>
	)
}

export default SignalPage
